import React, { Component } from 'react';
import { Switch, Route, Redirect } from 'react-router-dom';
import { withRouter } from 'react-router';
import { TransitionGroup, CSSTransition } from "react-transition-group";
import { Title } from 'shipnow-mercurio';

import { AppointmentsList } from './';

class AppointmentsRouter extends Component {

  render() {
    const FakeContent = withRouter( (props) => (
      <div>
        <Title>{ props.location.pathname }</Title>
      </div>
    ));
    const path = this.props.match.path;
    const location = this.props.location;
    return(
        <TransitionGroup className="transition-group">
          <CSSTransition 
            key={location.pathname}
            timeout={300}          
            classNames="sectionTransition">
              <section className="transition-wrapper">
                <Switch location={ location }>
                  <Route exact path ={ `${path}/appointments`         }  component={ null } />
                  <Route exact path ={ `${path}/appointments/list`    }  component={ null } />
                  <Route exact path ={ `${path}/appointments/reports` }  component={ null } />

                  <Redirect to={`${this.props.match.path}/appointments/list`} component={ AppointmentsList } />
                </Switch>
            </section>
          </CSSTransition>
        </TransitionGroup>
      );
  };

}

export default withRouter(AppointmentsRouter);
